import { useState } from 'react'
import image from './logo192.png'
import styles from './styles/VideoList.module.css'

const videos = [
	{
		name: 'Назва відео 1',
		duration: 15,
		id: 1,
	},
	{
		name: 'Назва відео 2',
		duration: 15,
		id: 2,
	},
	{
		name: 'Назва відео 3',
		duration: 212,
		id: 3,
	},
	{
		name: 'Назва відео 4',
		duration: 1123,
		id: 4,
	},
]

export function VideoList({ details, setDetails }) {
	const [count, setCount] = useState(0)
	return (
		<>
			{isAuth ? 'Авторизовані' : 'Не авторизовані'}
			<h1 className={styles.FirstCLASS}> Video List </h1>
			{videos.map(video => {
				return (
					<div key={video.id}>
						<img src={image} alt='' />
						<p>{video.name}</p>
						<p>{video.duration}</p>
						<button onClick={() => setCount(count => count + 1)}>
							{' '}
							{details.buttonText}
						</button>
						<p>{count}</p>
					</div>
				)
			})}
		</>
	)
}
